import React from 'react';
import fixtures from '../apis/fixtures';

class App extends React.Component {
    constructor(props) {
        super(props);

        this.state = { fixtures: [1, 2, 3] }

        fixtures.get().then((res) => {
            console.log(res.data.api.fixtures);
            this.setState({ fixtures: res.data.api.fixtures });
        }).catch(function (error) {
            console.log(error);
        });
    }

    render() { 
        const { fixtures } = this.state;
        return ( 
            <div>
                {fixtures.map(fixture => <div>fixture.referee</div>)}
            </div>
         );
    }
}

export default App;
